import React from 'react';
import ReactDOM from 'react-dom/client';

export default function Navigation() {
    return (
        <div className="Navigation">
        <a className="NavigationCities" href="#" target="_blank" rel="nofollow">
          Kyiv
        </a>
        <a className="NavigationCities" href="#" target="_blank" rel="nofollow">
          Lisbon
        </a>
        <a className="NavigationCities" href="#" target="_blank" rel="nofollow">
          Paris
        </a>
        <a className="NavigationCities" href="#" target="_blank" rel="nofollow">
          San Francisco
        </a>
      </div>
    )
}
